import React from 'react'
import "./dirilisepisodes.css"
import ReactPlayer from 'react-player'
import { Carddirilis } from '../Carddirilis/Carddiriliss';


export const DrirlisEpisode1 = () => {

   return (
      <div className='ena'>
      <div className='videocop'>
          <ReactPlayer url='https://youtu.be/5fJXATpIiUQ' controls playing={true} muted width="1080px" height="720px" onEnded
          />
      </div>
       
      <div className='cardepisode'>
      <h3>Episodes</h3>
        <Carddirilis />
      </div>
      </div>
    )
  };

  export const DrirlisEpisode2 = () => {

    return (
       <div>
       <div className='videocop'>
           <ReactPlayer url='https://youtu.be/oQaUlvYebLA' controls playing={true} muted width="1080px" height="720px" onEnded
           />
       </div>
       <div className='cardepisode'>
      <h3>Episodes</h3>
        <Carddirilis />
      </div>
       </div>
     )
   };

